import React from 'react';
import './Drawing.scss';

class Drawing extends React.Component {

  render() {    
    return (
      <div className="drawing">
        <h1>WebSite B Theories</h1>
        <p>Here you will find pages about little known phenomenons I've collected over the years</p>
        <marquee>Read at your own risk!!</marquee>
      </div>
    );
  }
}

export default Drawing;
